import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight, MapPin, TrendingUp, Star } from 'lucide-react';

const Hero = () => {
  return (
    <section className="relative min-h-screen flex items-center justify-center bg-gradient-to-br from-[#0F172A] via-black to-[#0F172A] overflow-hidden">
      {/* Background Pattern */}
      <div className="absolute inset-0 opacity-20">
        <div className="absolute inset-0 bg-[radial-gradient(circle_at_1px_1px,rgba(255,255,255,0.08)_1px,transparent_0)] bg-[length:20px_20px]"></div>
      </div>

      <div className="container mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
        <div className="text-center max-w-4xl mx-auto">
          {/* Main Headline */}
          <motion.h1 
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="text-4xl md:text-6xl lg:text-7xl font-bold text-white mb-6 leading-tight font-poppins drop-shadow-xl"
          >
            Dominate Google Maps. Win Local Leads.
          </motion.h1>

          {/* Subheadline */}
          <motion.p 
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="text-xl md:text-2xl text-gray-300 mb-8 max-w-3xl mx-auto leading-relaxed font-inter"
          >
            Transparent plans. Real leads. Real local ranking results.
          </motion.p>

          {/* CTA Buttons */}
          <motion.div 
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="flex flex-col sm:flex-row gap-4 justify-center items-center mb-12"
          >
            <button className="btn flex items-center gap-2 font-poppins">
              Book Free Strategy Call
              <ArrowRight className="w-5 h-5" />
            </button>
            <button className="btn bg-white/10 hover:bg-white/20 text-white border border-white/20 backdrop-blur-sm font-poppins">
              Get a Free Audit
            </button>
          </motion.div>

          {/* Social Proof */}
          <motion.div 
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            className="bg-white/5 backdrop-blur-sm rounded-2xl p-6 border border-white/10"
          >
            <p className="text-gray-300 text-lg mb-4 font-inter">
              Used by contractors, clinics, and service pros
            </p>

            {/* Logo Slides */}
            <div className="flex justify-center items-center gap-8 flex-wrap">
              <div className="bg-white/10 rounded-lg px-6 py-3 text-white font-semibold font-inter">
                <MapPin className="inline w-5 h-5 mr-2 text-accent" /> Contractors
              </div>
              <div className="bg-white/10 rounded-lg px-6 py-3 text-white font-semibold font-inter">
                <Star className="inline w-5 h-5 mr-2 text-accent" /> Clinics
              </div>
              <div className="bg-white/10 rounded-lg px-6 py-3 text-white font-semibold font-inter">
                <TrendingUp className="inline w-5 h-5 mr-2 text-accent" /> Service Pros
              </div>
              <div className="bg-white/10 rounded-lg px-6 py-3 text-white font-semibold font-inter">
                <MapPin className="inline w-5 h-5 mr-2 text-accent" /> Local Business
              </div>
            </div>
          </motion.div>

          {/* Trust Indicators */}
          <motion.div 
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.8 }}
            className="flex flex-wrap justify-center items-center gap-8 mt-12 text-gray-300"
          >
            <div className="flex items-center gap-2">
              <Star className="w-5 h-5 text-accent" />
              <span>500+ Local Rankings</span>
            </div>
            <div className="flex items-center gap-2">
              <MapPin className="w-5 h-5 text-accent" />
              <span>Map Pack Domination</span>
            </div>
            <div className="flex items-center gap-2">
              <TrendingUp className="w-5 h-5 text-accent" />
                              <span>30-Day Commitment</span>
            </div>
          </motion.div>
        </div>
      </div>

      {/* Floating Elements */}
      <motion.div 
        animate={{ y: [-10, 10, -10] }}
        transition={{ duration: 4, repeat: Infinity, ease: "easeInOut" }}
        className="absolute top-20 left-10 w-4 h-4 bg-accent rounded-full opacity-60"
      />
      <motion.div 
        animate={{ y: [10, -10, 10] }}
        transition={{ duration: 6, repeat: Infinity, ease: "easeInOut" }}
        className="absolute bottom-20 right-10 w-6 h-6 bg-white/20 rounded-full"
      />
    </section>
  );
};

export default Hero;
